import React, { Component } from "react";

class form extends Component {
  render() {
    return (
      <div className="App">
        <Input
          placeholder="Basic usage"
          size="middle"
          style={{ width: "300px" }}
        />
        <Button type="primary">add</Button>
      </div>
    );
  }
}

export default form;
